  false,\n\t\"url\": null,\n\t\"notes\": \"The 4 km Pathfinder effort at the National
  Oceanic and Atmospheric Administration (NOAA) National Oceanographic Data Center
  (NODC) and the University of Miami's Rosenstiel School of Marine and Atmospheric
  Science (RSMAS) is an extension of and improvement on the sea surface temperature
  (SST) fields from the NOAA/NASA AVHRR Oceans 9km Pathfinder dataset. In this 4 km
  Pathfinder project, some important shortcomings in the original 9 km data have been
  corrected, and the entire time series has been reprocessed at the 4 km Global Area
  Coverage (GAC) level, the highest resolution possible globally. Twice-daily SST
  and related parameters back to 1981 have been produced, as well as temporal averages
  for 5-day, 7-day, 8-day, monthly, and yearly periods. This information is archived
  at the National Oceanographic Data Center (https://www.nodc.noaa.gov/). This metadata
  record describes the temporally averaged SST data and related parameters available
  for 1981-2009. Data for all years and time periods are available as separate NODC
  accessions. These data were collected through the operational periods of the NOAA-7
  through NOAA-18 Polar Operational Environmental Satellite (POES).\",\n\t\"license_title\":
